import Header from './header';
import Footer from './footer';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import styles from '../screens/CSS/home.module.css';
import imageTest from '../assets/testproduct.jpg'
import { style } from '@mui/system';
import { Rating } from '@mui/material';

function ProductInformation({navigation}) {
    return (
      <div className={styles.Home}>
        <Header navigation={navigation}/>
        <div className={styles.content} >
          <div className={styles.wraper}>
            <p className={styles.tdisplay}> Product Information</p>
            <div className={styles.productInfo}>
              <div className="image">
                <Card sx={{ maxWidth: 345 }}>
                  <CardActionArea>
                    <CardMedia
                      component="img"
                      image={imageTest}
                      alt="green iguana"
                    />
                  </CardActionArea>
                </Card>
              </div>
              <div className={styles.infor}>
                  <h3>San pham Mo hinh</h3>
                  <div  className={styles.productInfo}>
                    <div>                  
                      <Rating name="half-rating-read" precision={0.5} readOnly />
                    </div>
                    <div>                  
                      <h3>Binh Luan</h3>
                    </div>
                    <div>                  
                      <h3>Binh Luan</h3>
                    </div>
                  </div>
              </div>
            </div>
        </div>
      </div>
      <Footer navigation={navigation}/>
    </div>
    );
  }
  
  export default ProductInformation;
